function arrayShuffle(array) {
    for (let i = array.length - 1; i > 0; i--) {
        let j = Math.floor(Math.random() * (i + 1));
        [array[i], array[j]] = [array[j], array[i]];
    }
}

function randomInteger(min, max) {
    let rand = min + Math.random() * (max + 1 - min);
    return Math.floor(rand);
}

function eventsMinilancer(status) {
    if(status.ContractId == metadataId){
        if(status.Name == "ContractEnd"){
            //Mission completed
            if(missionTimeCompleted + 5 < Math.floor(Date.now() / 1000)){
                missionTimeCompleted = Math.floor(Date.now() / 1000);
                missionInfo.eliminatedSyndicate++;
                itemsTimestamp = [];
                addItemInventory(missionInfo.reward);
                generationNewMission();
                saveMinilancer();
            }
        }

        if(status.Name == "ContractFailed"){
            //Misiion failed
            if(missionTimeCompleted + 5 < Math.floor(Date.now() / 1000)){
                itemsTimestamp = [];
                if(status.Value == "Contract ended manually: OnRestartLevel") return;
                if(status.Value == "Contract ended manually: OnReplanLevel") return;
                if(status.Value == "Contract ended manually: User pressed exit to Main menu") return;

                itemList = defaultItemsList;
                missionInfo.itemList = itemList;

                generationNewMission();
                saveMinilancer();

                missionTimeCompleted = Math.floor(Date.now() / 1000);
            }
        }

        if(status.Name == "ItemPickedUp"){
            if (itemsTimestamp.includes(status.Timestamp)) return;

            if(!includeItems.includes(status.Value.RepositoryId)){
                for (let i = 0; i < status.Value.OnlineTraits.length; i++){
                    if(excludeItems.includes(status.Value.OnlineTraits[i])) return;
                }
            }

            try{
                addItemInventory(status.Value.RepositoryId);
            }
            catch(e){
                itemList = defaultItemsList;
            }

            itemsTimestamp.push(status.Timestamp)
        }

        if(status.Name == "ItemThrown" || status.Name == "ItemDropped" || status.Name == "ItemRemovedFromInventory"){
            if (itemsTimestamp.includes(status.Timestamp)) return;

            const indexItemList = itemList.indexOf(status.Value.RepositoryId);
            if (indexItemList > -1) itemList.splice(indexItemList, 1);

            itemsTimestamp.push(status.Timestamp)
        }
    }
}

function generationInventory(){
    let rebuildItemList = [];
    let newItemList = [];

    for (let i = 0; i < missionInfo.itemList.length; i++){
        if(!rebuildItemList.includes(missionInfo.itemList[i])){
            rebuildItemList.push(missionInfo.itemList[i]);
        }
    }

    missionInfo.itemList = rebuildItemList;
    itemList = rebuildItemList;

    for (let i = 0; i < missionInfo.itemList.length; i++){
        newItemList.push(
            {
                Id: missionInfo.itemList[i],
                Properties: {
                    LoadoutSlot: "gear",
                    RepositoryId: missionInfo.itemList[i]
                }
            }
        );
    }

    mandatoryLoadout = newItemList;
}

function addItemInventory(id){
    itemList.push(id);
}

function saveMinilancer(){
	try{
		let data = {
            missionInfo: missionInfo
		};

		fs.writeFileSync('userdata/Minilancer.save', JSON.stringify(data));
	}
	catch(e){
		log(LogLevel.INFO, "[Minilancer] Failed to create a new profile. Is it possible to save files in the peacock folder?");
	}
}

function readMinilancer(){
	try{
		let rawdata = JSON.parse(fs.readFileSync('userdata/Minilancer.save'));
		itemList = rawdata.missionInfo.itemList;
        missionInfo = rawdata.missionInfo;
	}
	catch(e){
        generationNewMission();
		saveMinilancer();
		log(LogLevel.INFO, "[Minilancer] Creating a new minilancer profile");
	}
	
	if (typeof(itemList) == "undefined" || typeof(itemList) == null ) {
		itemList = defaultItemsList;
	}
	
}

function minilancerUnpackImages(){
	if (fs.existsSync(minilancerImageDir)) return;
	
	log(LogLevel.INFO, "[Minilancer] Unpack Images");
	
	try{
		let minilancerImages = [
			["campaign", ""],
            ["title",""],
            ]	
		
		fs.mkdirSync(minilancerImageDir);
		
		for (let i = 0; i < minilancerImages.length; i++){
			fs.writeFile(minilancerImageDir + minilancerImages[i][0] + ".png", minilancerImages[i][1], 'base64', function(err) {
			  console.log(err);
			});
		}	
	}
	catch(e){
		log(LogLevel.INFO, "[Minilancer] Unpack images error: " + e);
	}
}